sources.styles\\utils\\_mixins.scss:
@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin top-actions {
  --icon-width: 18px;

  display: grid;
  grid-template-columns: 1fr var(--icon-width) var(--icon-width);
  justify-items: left;
  align-items: center;
  column-gap: 30px;

  @include onDesktop {
    --icon-width: 24px;
    column-gap: 40px;
  }
}

sources.styles\\blocks\\header.scss:
.header {
  background-position: center;
  background-size: cover;

  background-image: url(../images/Bose/header_320.jpg);

  @include onDesktop {
    background-image: url(../images/Bose/header_png.png);
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    box-sizing: border-box;
    height: 100vh;
    padding: $headerTopPadding 0 94px;

    @include onDesktop {
      padding-bottom: 64px;
    }
  }

  &__top {
    @include top-actions;
  }

  &__title {
    font-style: italic;
    font-weight: 800;
    font-size: 32px;
    line-height: 100%;
    letter-spacing: -1.5px;

    @include onDesktop {
      font-size: 48px;
    }

    &::before {
      content: "";
      background-image: url(../images/Bose/iconH1.svg);
      display: block;
      width: 32px;
      height: 27px;
      margin-bottom: 16px;

      @include onDesktop {
        background-image: url(../images/Bose/sound_wave.svg);
        width: 63px;
        height: 76px;
        margin-bottom: 32px;
      }
    }
  }
}

sources.styles\\blocks\\icon.scss:
.icon {
  position: relative;
  display: block;
  width: 100%;
  padding-bottom: 100%;

  background-position: center;
  background-size: contain;
  background-repeat: no-repeat;
  text-decoration: none;

  &__tooltip {
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translateY(-50%);

    display: block;
    width: max-content;
    padding-right: 10px;

    color: $colorGrey;
    letter-spacing: 2px;
    text-transform: uppercase;
    font-size: 12px;
    line-height: 16px;
    opacity: 0;
    pointer-events: none;

    transition: opacity 0.3s;
  }

  &:hover &__tooltip {
    opacity: 1;
    pointer-events: all;
  }

  &--menu {
    background-image: url(../images/Bose/Vectormenu.svg);
    transition: all 0.3s;

    &:hover {
      background-image: url(../images/Bose/Vectormenuhover.svg);
    }
  }

  &--phone {
    background-image: url(../images/Bose/Vectorphone.svg);
  }

  &--cross {
    background-image: url(../images/Bose/Vectorcross.svg);
    transition: scale 0.3s;

    &:hover {
      transform: scale(1.2);
    }
  }
}

sources.styles\\blocks\\menu.scss:
.menu {
  background-color: #e5e5e5;

  &__content {
    box-sizing: border-box;
    height: 100vh;
    padding: $headerTopPadding 0;

    overflow-y: auto;
  }

  &__top {
    @include top-actions;
    grid-template-columns: 1fr var(--icon-width);
    margin-bottom: 55px;

    @include onDesktop {
      margin-bottom: 80px;
    }
  }

  &__list {
    margin: 0 0 40px;
    padding: 0;
    list-style: none;
  }

  &__item {
    margin-bottom: 24px;

    &:last-child {
      margin-bottom: 0;
    }
  }

  &__link {
    display: inline-block;
    padding-bottom: 8px;
    border-bottom: 1px solid transparent;

    font-size: 22px;
    line-height: 22px;
    text-decoration: none;
    color: $colorGrey;
    letter-spacing: 2px;
    text-transform: uppercase;

    transition: border-color 0.3s;

    &:hover {
      border-color: $colorGrey;
    }
  }

  &__call {
    display: block;
    width: max-content;

    font-size: 16px;
    line-height: 27px;
    letter-spacing: 2px;
    text-transform: uppercase;
    color: $colorGrey;
    text-decoration: none;
    transition: all 0.3s;

    &--phone {
      margin-bottom: 16px;

      &:hover {
        color: aqua;
      }
    }

    &--action {
      font-size: 12px;
      line-height: 16px;
      padding-bottom: 8px;
      border-bottom: 1px solid $colorGrey;

      &:hover {
        color: aqua;
        border-bottom-color: aqua;
      }
    }
  }
}

sources.styles\\blocks\\page.scss:
.page {
  font-family: "Inter", sans-serif;
  font-weight: 700;
  font-style: normal;
  font-size: 16px;
  line-height: 140%;
  color: $colorGrey;

  scroll-behavior: smooth;

  &__body {
    margin: 0;

    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    transform: translateX(+100%);
    transition: transform 0.3s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 120px;
  }

  &__section-title {
    margin-bottom: 0 0 32px;

    font-size: 32px;
    line-height: 32px;
    text-align: center;
    letter-spacing: -1.5px;
    color: $colorGrey;

    @include onDesktop {
      margin-bottom: 56px;
      font-size: 48px;
      line-height: 48px;
    }

    &::after {
      content: "";
      display: block;
      width: 23px;
      height: 16px;
      margin: 6px auto 32px;
      background-image: url(../images/crown.svg);
      background-position: center;
      background-size: contain;
      background-repeat: no-repeat;

      @include onDesktop {
        margin: 6px auto 60px;
      }
    }
  }
}

