sources.styles\\blocks\\grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
    column-gap: 24px;
  }

  &--desktop {
    display: block;

    @include onDesktop {
      display: grid;
    }
  }

  &__item {
    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

sources.styles\\blocks\\about.scss:
.aboutus {
  &__item {
    margin-bottom: 48px;

    &:last-child {
      margin-bottom: 0;
    }

    @include onDesktop {
      margin-bottom: 0;
    }
  }
}

.about {
  &__photo-container {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    column-gap: 24px;

    margin-bottom: 32px;
  }

  &__photo {
    grid-column: 2 / 4;
    width: 100%;
    transition: 0.3s;

    &:hover {
      transform: scale(1.1);
    }

    @include onDesktop {
      grid-column: 1 / 5;
    }
  }

  &__name {
    margin: 0 0 8px;

    font-size: 16px;
    line-height: 140%;
    transition: all 0.3s;

    &:hover {
      transform: scale(1.05);
    }
  }

  &__role {
    margin: 0 0 12px;
    font-weight: 400;
  }
}

.link {
  text-decoration: none;
  color: $colorGrey;
}

sources.styles\\blocks\\button.scss:
.button {
  display: flex;
  justify-content: center;
  align-items: center;

  box-sizing: border-box;
  width: 100%;
  height: 56px;
  border: 2px solid $colorGrey;
  border-radius: 40px;

  font-size: 16px;
  line-height: 27px;
  text-decoration: none;
  color: #fff;
  background-color: $colorGrey;
  border-color: $colorGrey;

  cursor: pointer;
  transition: all 0.3s;

  &--primary {
    margin-bottom: 34px;
    font-weight: 700;
  }

  &:hover {
    color: $colorGrey;
    border-color: $colorGrey;
    background-color: #e5e5e5;
  }

  &:active {
    color: #fff;
    border-color: #111;
    background-color: #111;
  }
}

sources.styles\\blocks\\place.scss:
.place {
  &__photo-container {
    position: relative;
    box-sizing: border-box;
    width: 100%;
    max-height: 320px;
    overflow: hidden;

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include onDesktop {
      height: 320px;
      padding-bottom: 0;
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;

    object-fit: cover;
    object-position: center;

    transition: 0.3s;

    &:hover {
      transform: scale(1.3);
    }
  }

  &__photos {
    margin-bottom: 16px;
  }

  &__link {
    color: $colorGrey;
    text-decoration: none;
  }
}

sources.styles\\blocks\\testimonials.scss:
.testimonial {
  &__content {
    @include onDesktop {
      display: grid;
      grid-template-columns: repeat(12, 1fr);
      column-gap: 24px;
    }
  }

  &__title {
    margin: 0 0 32px;

    font-size: 32px;
    line-height: 32px;
    letter-spacing: -1.5px;
    color: $colorGrey;

    @include onDesktop {
      grid-column: 1 / 6;
      margin-bottom: 0;
      font-size: 48px;
      line-height: 48px;
    }
  }

  &__description {
    @include onDesktop {
      grid-column: 7 / 11;
    }
  }

  &__subtitle {
    display: block;
    margin-bottom: 16px;
    font-size: 16px;
    line-height: 140%;
    color: $colorGrey;
    text-decoration: none;
  }

  &__paragraph {
    margin: 40px 0 0;
    font-weight: 400;
    line-height: 27px;
    color: $colorGrey;
  }
}

sources.styles\\blocks\\contact-us.scss:
.contact-us {
  &__info {
