    }
  }
}

sources.styles\\blocks\\form-field.scss:
.form-field {
  box-sizing: border-box;
  display: block;
  width: 100%;
  height: 48px;
  border: 1px solid transparent;
  border-radius: 40px;
  padding: 14px 16px;
  color: #000;
  background-color: #f8f8fa;

  &::placeholder {
    font-size: 14px;
    line-height: 20px;
    color: #7e7e83;
  }

  &:hover {
    border-color: #d5d7de;
  }

  &:focus {
    border-color: $colorGrey;
    outline: none;
  }

  &--textarea {
    height: 148px;
    font-family: inherit;
    resize: none;
    border-radius: 16px;
  }
}
